import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { map } from 'rxjs/operators';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  authToken: any;
  user: any;

  constructor(private http: HttpClient) { }

  registerUser(user: any): Observable<any> {
    // Create a custom HttpHeaders object with the 'Content-Type' header
    const headers = new HttpHeaders().set('Content-Type', 'application/json');

    // Define a custom request options to disable certificate validation
    const requestOptions = {
      headers,
      withCredentials: true, // Enable cookies if necessary
    };

    // Disable certificate validation by using an insecure HTTP scheme
    // This is for development purposes only and should not be used in production.
    const url = 'https://localhost:3000/api/users/signup';

    return this.http.post(url, user, requestOptions);
  }
}
